import React from "react";
import '../styles/dash.css'
import { Link } from "react-router-dom";


/*Importaciones de imagenes*/
// import diseno from '../img/Untitled.png';
// import graficoimg from '../img/countries.png';
import grupo from '../images/grupo.png'
import music from '../images/musica.png'
import album from '../images/album.png'
import artis from '../images/artista.png'

/*Desde aqui comienza el sitio web*/
function Dash() {

    return (
       
<>

<body>
    
<header class="cabecera">


        {/* <div class="clase1">
            <p class="parrafo">
                Bienvenido usuario Administrador al Dashboard, aquí puedes
                editar, eliminar, crear usuarios o lo que se necesite para
                agreagar a la aplicación web, siempre y cuando tengas los permisos
                necesarios para poder hacerlo, debes tener precaución con lo que haces
                para que no hayan errores al momento de querer modificar algo desde aqui, por eso
                solo el personal autorizado tiene permitido entrar al Dash y poder hacer uso 
                de él, mucha suerte.
            </p>

            Imagenes agregadas sobre las estadisticas 
            </div> */}
            
            <div class="listado">
                
            {/* <img class="icono1" src={diseno} alt="Usuarios" /> */}
            
            <div className="contenedor-principal">
                <h1>Das</h1>
        <div className="barra-lateral">
          <div className="carta">
          <img className="grupo" src={grupo} alt="" />
            <h2 className="carta-titulo">Usuarios</h2>

            {/* <p className="carta-descripcion">Aquí puedes editar, eliminar o crear usuarios.</p> */}
          </div>
          <div className="carta">
          <img className="grupo" src={music} alt="" />
            <h2 className="carta-titulo">Canciones</h2>
            {/* <p className="carta-descripcion">Aquí puedes editar, eliminar o crear canciones.</p> */}
          </div>
          <div className="carta">
          <img className="grupo" src={album} alt="" />
            <h2 className="carta-titulo">Álbumes</h2>
            {/* <p className="carta-descripcion">Aquí puedes editar, eliminar o crear álbumes.</p> */}
          </div>
          <div className="carta">
          <img className="grupo" src={artis} alt="" />
            <h2 className="carta-titulo">Artistas</h2>
            
            {/* <p className="carta-descripcion">Aquí puedes editar, eliminar o crear artistas.</p> */}
          </div>
        </div>
        <div className="contenido-principal">
          {/* Contenido principal */}
        </div>
        
      </div>

            </div>
        </header>


        <h2>Bienvenido</h2>
            <div className="muestra">
            {/* <img class="img1" src={graficoimg} alt="Grafico" /> */}
            </div> 
            

    
</body>


        </>



    )


}

export default Dash;
